# MySQL init script that creates Tables for FlowData, Templates, Meters, Alerts, Subscribers, Notifications, Prss, Ssns

# Create Database
DROP DATABASE IF EXISTS 'swm';
CREATE DATABASE 'swm';
use swm;

# Create FlowData with whenRecorded, estimatedFlow, actualFlow, mtrId
DROP TABLE IF EXISTS `FlowData`;
CREATE TABLE `FlowData` (
  `whenRecorded` datetime NOT NULL,
  `estimatedFlow` double NOT NULL,
  `actualFlow` double DEFAULT NULL,
  `mtrId` int NOT NULL,
  PRIMARY KEY (`whenRecorded`, `mtrId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

